import React from "react";

import '../Css/Boton-Nav.css';


function BarraNav(props){
  return(
    <div className = 'contenedor'>
      <img
        className = 'imagenBarra'
        src = {props.direccion}
        alt = 'Logo barra nav' />
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag}>{props.titulo2}</Link>
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo3}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo4}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo5}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo6}
      </label>
    </div>
  );
};

export default BarraNav;
